          placeholder="verify-password"
          id="vpassword"
          name="vpassword"
        />

        <button type="submit">Sign Up</button>
      </form>
      <button className="link-btn" onClick={() => props.onFromSwitch("login")}>
        Already have an account? Login
      </button>
    </div>
  );
};
